import { useNavigate } from "react-router-dom";
import { Button } from "@/components/ui/button";

export default function LoginSelection() {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <h1 className="text-3xl font-bold mb-6">Select Your Role</h1>
      <div className="space-x-4">
        <Button onClick={() => navigate("/login/admin")} className="px-6 py-3 text-lg">
          Login as Admin
        </Button>
        <Button onClick={() => navigate("/login/employee")} className="px-6 py-3 text-lg">
          Login as Employee
        </Button>
      </div>
    </div>
  );
}

export function AdminLogin() {
  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <h1 className="text-3xl font-bold mb-6">Admin Login</h1>
      <form className="flex flex-col space-y-4">
        <input type="text" placeholder="Username" className="border p-2" />
        <input type="password" placeholder="Password" className="border p-2" />
        <Button type="submit" className="px-6 py-3 text-lg">Login</Button>
      </form>
    </div>
  );
}

export function EmployeeLogin() {
  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <h1 className="text-3xl font-bold mb-6">Employee Login</h1>
      <form className="flex flex-col space-y-4">
        <input type="text" placeholder="Username" className="border p-2" />
        <input type="password" placeholder="Password" className="border p-2" />
        <Button type="submit" className="px-6 py-3 text-lg">Login</Button>
      </form>
    </div>
  );
}
